import React, { Component, Img } from 'react';
import App from '../App'
import { Menu, Icon, Layout, Breadcrumb, Table } from 'antd';

class BitcoinTableWatcher extends Component {
  state = {
    data : [],
    text: `<div>
      <ul>
        {this.state.data.map(li => (
          <li>{li.name}: {li.price_usd}</li>
        ))}
      </ul>
    </div>`
  }
  // async componentDidMount () {
  //   await fetch("https://api.coinmarketcap.com/v1/ticker/?limit=10")
  //     .then(res => res.json())
  //     .then(json => this.setState({ data: json }))
  // }
  onClick (e) {
    e.preventDefault();
  }
  render () {
    return (
      <div>
      <form type='text' className="bitcoin" placeholder='enter your bitcoin name'/>
      <button onClick={this.onClick()}/>
      </div>
    )
  }
}

export default BitcoinTableWatcher;
